import React from "react";
import { Segment, Grid, Divider } from "semantic-ui-react";

class About extends React.Component {
  render() {
    return (
      <Segment>
        <Grid columns={2} relaxed="very" />
        <Divider vertical />
      </Segment>
    );
  }
}

export default About;
